import React from "react";

function teamMember(props) {
    return (
        <div className=" col-3 col-sm-4 justify-content-center">  
            <div className="card">
                <div className="card-header">  
                    {/* <img src = { props.info.img} alt=""></img>    */}
                </div> 

                <div className="card-body" style={{backgroundColor: props.info.email ? 'white':'black'}}>
                    <h2>{props.info.name } </h2>    
                    <h3>{props.info.phone}</h3>
                    <h4>{props.info.email}</h4>

               </div> 
            
            </div>

        </div>
    )
}

export default teamMember
